import React, { useState } from 'react';
import axios from 'axios';

const Main = () => {

  const [symbol, setSymbol] = useState('');
  const [trackingSymbol, setTrackingSymbol] = useState('');
  const [stockInfo, setStockInfo] = useState(null);

  const handleSymbolChange = (e) => {
    setSymbol(e.target.value);
  };

  const handleTrackingSymbolChange = (e) => {
    setTrackingSymbol(e.target.value);
  };

  const handleFormSubmit = async (e) => {
    console.log('sdkjvnblsdkjvbnlskjn');
    e.preventDefault();
    try {
      const response = await axios.get(`http://localhost:3000/stock/${symbol}`);
      setStockInfo(response.data);
      console.log(response.data);
    } catch (error) {
      console.error(`Error fetching stock information: ${error}`);
    }
  }

  const handleStartTracking = async () => {
    try {
      await axios.put(`http://localhost:3000/stock/${trackingSymbol}`);
      console.log(`Started tracking for symbol: ${trackingSymbol}`);
    } catch (error) {
      console.error(`Error starting tracking: ${error}`);
    }
  };

  const formatTimestamp = (timestamp) => {
    const date = new Date(timestamp);
    return date.toLocaleString();
  };

  return (
    <div className="flex flex-col items-center">
      <div>
        <h1 className="font-satoshi text-3xl text-slate-300 p-6">Stock symbol getter</h1>
      </div>
      <div className="mt-3 max-w-5xl">
        <p className="font-satoshi text-xl text-slate-300">Insert any official NASDAQ stock symbol to find out the current price and the moving average.</p>
        <p className="font-satoshi text-xl text-slate-300">(Note: The moving average can only be calculated after 10 minutes, because the server periodically asks for the current price, and we need 10 pieces of data)</p>
      </div>
      <form
          onSubmit={handleFormSubmit}
          className="mt-8 w-full max-w-md flex flex-col gap-2 glassmorphism ustify-center items-center border border-gray-300 p-6 rounded-lg">
            <label>
              <span className="font-satoshi text-xl text-slate-300">Symbol name</span>
            </label>
            <input 
                className="p-3 m-2 h-8 rounded-md" 
                type="text"
                value={symbol}
                onChange={handleSymbolChange} 
            />
            <div className="flex-end mx-3 mb-5 gap-4">
              <button type="submit" className="px-14 py-2 text-xl bg-amber-800 hover:bg-amber-700 rounded-full text-slate-100">
                Check
              </button>
            </div>   
            <label>
              <span className="font-satoshi text-xl text-slate-300">Tracking symbol</span>
            </label>
            <input
              className="p-3 m-2 h-8 rounded-md"
              type="text"
              value={trackingSymbol}
              onChange={handleTrackingSymbolChange}
            />
            <div className="flex-end mx-3 mb-5 gap-4">          
              <button
                type="button"
                onClick={handleStartTracking}
                className="px-14 py-2 text-xl bg-amber-800 hover:bg-amber-700 rounded-full text-slate-100"
              >
              Start Tracking
              </button>
            </div>
        </form>

      {stockInfo && (
        <div className="flex mt-8">
        <div className="mr-8">
          <p className="font-satoshi text-2xl text-slate-300">Symbol:</p>
          <p className="font-satoshi text-2xl text-slate-300">Current Price:</p>
          <p className="font-satoshi text-2xl text-slate-300">Last Updated Time:</p>
          <p className="font-satoshi text-2xl text-slate-300">Moving Average:</p>
        </div>
        <div>
          <p className="font-satoshi text-2xl text-slate-300">{stockInfo.symbol}</p>
          <p className="font-satoshi text-2xl text-slate-300">{stockInfo.currentPrice}</p>
          <p className="font-satoshi text-2xl text-slate-300">{formatTimestamp(stockInfo.lastUpdatedTime)}</p>
          <p className="font-satoshi text-2xl text-slate-300">{stockInfo.movingAverage}</p>
        </div>
      </div>
      )}
    </div>
  )
}

export default Main
